### YamlMime:TSType
name: PagedSecretValueResourceDescriptionList
uid: '@azure/servicefabric.PagedSecretValueResourceDescriptionList'
package: '@azure/servicefabric'
summary: >-
  The list of values of a secret resource, paged if the number of results
  exceeds the limits of a

  single message. The next set of results can be obtained by executing the same
  query with the

  continuation token provided in the previous page.
fullName: PagedSecretValueResourceDescriptionList
type: interface
properties:
  - name: continuationToken
    uid: >-
      @azure/servicefabric.PagedSecretValueResourceDescriptionList.continuationToken
    package: '@azure/servicefabric'
    summary: >-
      The continuation token parameter is used to obtain next set of results.
      The continuation token

      is included in the response of the API when the results from the system do
      not fit in a single

      response. When this value is passed to the next API call, the API returns
      next set of results.

      If there are no further results, then the continuation token is not
      included in the response.
    fullName: continuationToken
    syntax:
      content: 'continuationToken?: undefined | string'
      return:
        type: undefined | string
        description: ''
  - name: items
    uid: '@azure/servicefabric.PagedSecretValueResourceDescriptionList.items'
    package: '@azure/servicefabric'
    summary: One page of the list.
    fullName: items
    syntax:
      content: 'items?: SecretValueResourceDescription[]'
      return:
        type: '<xref uid="@azure/servicefabric.SecretValueResourceDescription" />[]'
        description: ''
